import {Button } from "@material-ui/core"
import {Person } from "@material-ui/icons"

function App() {
  return (
    <div className="App">
     <Button variant="contained" 
     startIcon={<Person/>} 
     style={{background:"purple",color:"white"}}

     >
       Hi there</Button>
    </div>
  );
}

export default App;
